import "./introPlain.css";
import Hinson from "../../img/hinson.jpg";
import Scroll from "../../img/scroll.svg";
import Discord from "./icons/Discord";
import Twitter from "./icons/Twitter";
import LinkedIn from "./icons/LinkedIn";

const IntroPlain = () => {
  const openURL = (url) => {
    const newWindow = window.open(url, "_blank", "noopener,noreferrer");
    if (newWindow) newWindow.opener = null;
  };

  return (
    <div className="ip" id="introplain">
      <div className="ip-head">
        div
        <div className="ip-h-left">{/* The social icon component */}</div>
        <div className="ip-h-right">
          <div className="i-bg-frame">
            {/* <img src={Hinson} alt="" className="i-img" /> */}
          </div>
          <div className="ip-socials">
            <div className="i-spacer-icon"></div>
            <div
              className="i-socials-icons"
              onClick={() =>
                openURL("https://discordapp.com/users/887269496568578058")
              }
            >
              <Discord />
            </div>
            <div
              className="i-socials-icons"
              onClick={() => openURL("https://twitter.com/SIDANLife")}
            >
              <Twitter />
            </div>
            <div
              className="i-socials-icons"
              onClick={() =>
                openURL("https://www.linkedin.com/in/hinson-wong-137b9a152/")
              }
            >
              <LinkedIn />
            </div>
            {/* <div className="i-spacer-icon"></div> */}
          </div>
        </div>
      </div>

      <div className="ip-tail">div.ip-</div>

      {/* The photo component */}
    </div>
  );
};

export default IntroPlain;
